import './Header.scss'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faClose } from '@fortawesome/free-solid-svg-icons';


export default function Header() {



    return (
        <div className="header">
            <span className='header__logo'>Vu Huy Bui</span>
            <div className='header__menu'>
                <div className='header__wrap open'>
                    <div className='header__navbar'>
                        <span className='header__nav'>Home</span>
                        <span className='header__nav'>About</span>
                        <span className='header__nav'>Projects</span>
                        <span className='header__nav'>Contacts</span>
                    </div>
                </div>
            </div>
        </div>
    )
}
